import React from "react";

class Test2 extends React.Component {
  constructor() {
    super();
    this.state = {
      isLoggedIn: true
    };
  }
  render() {
    return this.state.isLoggedIn ? <div>Yes</div> : <div>No</div>;
  }
}

export default Test2;
